import React, {Component} from 'react';
import Players from './Players';
import CreationPlayer from './CreationPlayer'

class App extends Component {
	constructor(){
		super()
		this.state = {
			name: "Alucard",
			lastname: "Dracula"
		}
	}
	render(){
		return(
			<div>
				<h1>Tennis Players</h1>
				<Players />
				<CreationPlayer />
				<h5>{this.state.name}</h5>
			</div>
		)		
	}
}

export default App;
